/**
 * Open Graph image assets
 * 
 * Logo images are embedded as base64 data URLs to ensure compatibility
 * with Cloudflare Workers environment where filesystem access is restricted.
 * 
 * IMPORTANT: Cloudflare Workers runs in V8 isolate, not Node.js runtime.
 * The `fs/promises` module does not work reliably in this environment.
 * By embedding assets as base64 strings, we eliminate filesystem dependency.
 */

export const LOGO_LIGHT_BASE64 = "";

/**
 * Returns the logo as a data URL for use in ImageResponse
 */
export function getLogoDataURL(): string {
  return `data:image/png;base64,${LOGO_LIGHT_BASE64}`;
}
